import logo from './logo.svg';
import './App.css';
import Menu from './components/Menu';
import Home from './pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <Router>  
        <Menu />
        <Switch>
          <Route path="/" exact component={Home}/>
        </Switch>
      </Router>
    </div>

  );
}

export default App;
